import React, { Component } from 'react';

export class Search extends Component {
    render(){
        return (
        <div>
            <div className="row justify-content-space-around searchBar">
                <div className="col-xs-4 retour">
                <button onClick={this.deconnexion} >
                    <span className="retour" style={{fontSize:16, color:"#660099",fontWeight:"bold"}}><span className="glyphicon glyphicon-menu-left"></span>Retour</span>    
                </button>
                    
                </div>
                    <div class="col-xs-6">
                        <input class="form-control" type="text" placeholder="Rechercher" aria-label="Search"/>
                    </div> 
                </div>
            <h3 style={{margin:100}}>this is the search page</h3>
        </div>
        );
    }
}
